import React from 'react';
import './master.css';

class EquipoGanador extends React.Component {

    render() {

      if (this.props.region1 != "") { 
                 return <div><p>{this.props.imagen1}</p>  <div className="ganador-region1"><img src={this.props.imagen1}/></
div></div>  } else { return <div/> }
}

}
export default EquipoGanador;
